import React from 'react'
import Project from './Project'

import projectsData from './projectsData'

function MyWork () {

    const myProjects = projectsData.map(item => <Project key={item.id} project={item}/>)
    
    const textStyle = {
        textAlign: 'center',
        color:'black',
        overflowY:'scroll',
    }
    return (
        <div style={textStyle}>
            <h1>My Work</h1>
            <div class="projects">
                {myProjects} 
            </div>
        </div>
    ) 
}

export default MyWork
